import styled from "styled-components";
import CustomButton from "../components/CustomButton"

function Login() {
  return (
    <Container>
      <LoginContainer>
        <Title>LOGIN</Title>
        <InputTitle>ID</InputTitle>
        <Input></Input>
        <InputTitle>PW</InputTitle>
        <Input></Input>
        <CustomButton text="YES!"/>
      </LoginContainer>
      <Line/>
      <LoginContainer>
        <Title>SIGN UP</Title>
        <InputTitle>ID</InputTitle>
        <Input></Input>
        <InputTitle>PW</InputTitle>
        <Input></Input>
        <InputTitle>PW CHECK</InputTitle>
        <Input></Input>
        <CustomButton text="YES!"/>
      </LoginContainer>
    </Container>
  );
}

const Container = styled.div`
    font-family: goblin;
    min-height:100vh;
    display:flex;
    flex-direction:vertical;
    justify-content:center;
`
const LoginContainer = styled.div`
    display:flex;
    height:400px;
    flex-direction:column;
    margin-top:auto;
    margin-bottom:auto;
    margin-right:60px;
    margin-left:60px;
`
const Title = styled.div`
    font-size:40px;
`
const InputTitle = styled.div`
    font-size:20px;
    margin-right:auto;
    margin-bottom:5px;
`
const Input = styled.input`
    background-color:#D9D9D9;
    width:360px;
    heightL65px;
    border-radius:40px;
    padding:10px;
    margin-bottom:30px;
`
const Line = styled.div`
    border-left : 1px solid black;
    height : 500px;
    margin-top:auto;
    margin-bottom:auto;
`
export default Login;
